import React from "react";
import Cards from "./Cards";

const Service = ()=>{
    return(
        <>
           <div className="container-fluid">
               <div className="row">
                   <div className="col-8">
                       <div className="row">
                           <div className="col-4">
                               <Cards />
                           </div>
                       </div>
                   </div>
               </div>
           </div>
        </>
    );
}

export default Service;
